import React from "react";
import { Text, View , StyleSheet , StatusBar , ImageBackground} from "react-native";
import Bg from '../assets/BG2.jpg'

const Tutorial = () => {
    return(
        <ImageBackground 
            source={Bg}
            resizeMode="cover"
            style={{flex: 1}}
            blurRadius={1}  
        >
            <StatusBar />
            {/* <Swiper> */}
                <View>
                    <Text> Slide 1</Text>
                </View>
                <View>
                    <Text> Slide 1</Text>
                </View>
                <View>
                    <Text> Slide 1</Text>
                </View>
            {/* </Swiper> */}
        </ImageBackground>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1
    }
})

export default Tutorial;
